import Data from './Data'

const SuggestionBox = ({text}) => {
    const renderSuggestions = () => {
        Data.filter((a) => {
            console.log(a, text)
            if(a.includes(text)){
                return true
            }
        })
    }


    return (
        <>
            {renderSuggestions()}
        </>
    )
}

export default SuggestionBox
